import React, { Component } from 'react';

class NotFound extends Component {

    notFound = () => {
        console.log("Page Not Found 404");
    }

    render() {
        return (
            <div>
                <h1>Page Not Found 404</h1>
            </div>
        );
    }
}

export default NotFound;
